import { render } from 'ejs';
import home from 'pages/Home';
import landing from 'pages/Landing';

import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";


import Routes from './pages/Routes';

const App = () => {
    return (
        <div>
            <Routes />
            <BrowserRouter>
                <Switch>
                    <Route path="/landing">
                        <landing/>
                    </Route>

                    <Route path="/landing">
                        <home/>
                    </Route>

                    <Route>

                    </Route>
                </Switch>
            </BrowserRouter>
        </div>
    )
}

export default App
